Imagine a land of endless summer, where girls walk around in tiny bikinis and sexy short dresses all year long! No winter boots, no big jackets, just hotties in summer dresses, showing off a huge amount of flesh. Sounds like paradise lost - and we're off to find this promiseland! But in the meanwhile, why don't you check out Alexa Nicole and Charisma Capelli, who seem to arrive right from this dream place...!
